import React, { useState } from "react";

const Header = () => {
  const [navbarOpen, setNavbarOpen] = useState(false);

  const toggleNavbar = () => {
    setNavbarOpen((prev) => !prev);
  };

  return (
    <header>
      <div className="nav-6 p-4 flex justify-between items-center border">
        <div className="container flex justify-between mx-auto items-center w-full">
          <h1 className="text-xl font-bold">Carrot</h1>
          <button
            aria-label="Toggle Navigation"
            aria-expanded={navbarOpen}
            className="lg:hidden inline-flex items-center justify-center text-black border h-10 w-10 rounded-md outline-none focus:outline-none"
            onClick={toggleNavbar}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 24 24"
              strokeWidth="1.5"
              stroke="currentColor"
              className="size-6"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5"
              />
            </svg>
          </button>
          <nav
            className={`lg:flex lg:justify-end lg:items-center lg:space-x-4 ${
              navbarOpen ? "block" : "hidden"
            } lg:block`}
          >
            <ul className="nav6 md:p-4 flex flex-col lg:flex-row justify-between space-x-0 lg:space-x-4 items-center">
              {["Product", "Our Why", "About Us", "Contact"].map((item) => (
                <li key={item}>
                  <a
                    href="#"
                    className="flex px-4 py-2 rounded-md font-medium text-black hover:bg-black hover:text-white"
                  >
                    {item}
                  </a>
                </li>
              ))}
            </ul>
          </nav>
        </div>
      </div>
      {navbarOpen && (
        <div className="lg:hidden">
          <nav className="flex flex-col items-center">
            <ul className="space-y-2">
              {["Product", "Our Why", "About Us", "Contact"].map((item) => (
                <li key={item}>
                  <a
                    href="#"
                    className="flex px-4 py-2 rounded-md font-medium text-black hover:bg-black hover:text-white"
                  >
                    {item}
                  </a>
                </li>
              ))}
            </ul>
          </nav>
        </div>
      )}
    </header>
  );
};

export default Header;
